import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';

let posts = [
    { message: "Congratulation!", like: "999999999999999999999999999999999999999999999999999999999999999999999999999999999999" },
    { message: "YOU'VE DONE IT!", like: "999999999999999999999999999999999999999999999999999999999999999999999999999999999999" },
  ]

  let dialogs = [
    { id: 1, name: "Sasha" },
    { id: 2, name: "Ira" },
    { id: 3, name: "Nadia" },
    { id: 4, name: "Olya" },
    { id: 5, name: "Lena" },
]


let messages = [
    {message:"HI"},
    {message:"MY NAME IS SASHA"},
    {message:"I LOVE KLYMENKO SO MUCH!"},
]

ReactDOM.render(<App posts={posts} dialogs={dialogs} messages={messages}/>, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
